import React from "react";
import Card from "./Card";

const CardList = ({robots}) => {
    const cardComponent = robots.map(user => {
        return (<Card 
                key={user} 
                id={robots[user].id} 
                name={robots[user].name} 
                email={robots[user].email}/>
    )
})
    return (
        <div>
            {cardComponent}
        </div>
    )
}
export default CardList;
